import React from "react";
import {
    Link
} from "react-router-dom";

import './bootstrap/css/bootstrap.min.css';


function NavbarItem({name, href}) {
    return (
        <li className="nav-item">
            <Link className="nav-link" to={href}>{name}</Link>
        </li>
    )
}

